import {apiUrl,filterData} from "./data";
import Navbar from "./components/Navbar";
import Filter from "./components/Filter";
import Cards from "./components/Cards";

const App = () => {

  return (
    <>

      <Navbar></Navbar>

      <Filter filterData={filterData}></Filter>

      <Cards></Cards>

    </>
  );
};

export default App;
